INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 0, "", 102301, 0, 71, 2, 80001, "アヤネ", 12, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 0, "", 104201, 0, 72, 1, 80001, "チカ", 12, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("私のことを見守ってください\nできることなら、ずっと…", 0, "", 104201, 0, 73, 2, 80001, "チカ", 12, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 0, "", 102101, 0, 74, 1, 80001, "クルミ", 12, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("で、でもこれからもずっと…\n一緒にいたいなぁ…", 0, "", 102101, 0, 75, 2, 80001, "クルミ", 12, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 0, "", 104901, 0, 76, 1, 80001, "シズル", 13, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 0, "", 104901, 0, 77, 2, 80001, "シズル", 13, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 0, "", 101101, 0, 78, 1, 80001, "リノ", 13, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 0, "", 101101, 0, 79, 2, 80001, "リノ", 13, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 0, "", 100201, 0, 80, 1, 80001, "ユイ", 14, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 0, "", 100201, 0, 81, 2, 80001, "ユイ", 14, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("騎士くんと出会って、まだ1年しか\nたってないんだ！？", 0, "", 100101, 0, 82, 1, 80001, "ヒヨリ", 14, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 0, "", 100101, 0, 83, 2, 80001, "ヒヨリ", 14, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 0, "", 100301, 0, 84, 1, 80001, "レイ", 14, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キミに背中を預けられる日が、\n早くきますように", 0, "", 100301, 0, 85, 2, 80001, "レイ", 14, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 0, "", 105801, 0, 86, 1, 80001, "ペコリーヌ", 15, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("これからもずっと、覚えていて\nくださいね！", 0, "", 105801, 0, 87, 2, 80001, "ペコリーヌ", 15, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 0, "", 105901, 0, 88, 1, 80001, "コッコロ", 15, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 0, "", 105901, 0, 89, 2, 80001, "コッコロ", 15, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 0, "", 106001, 0, 90, 1, 80001, "キャル", 15, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 0, "", 106001, 0, 91, 2, 80001, "キャル", 15, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 1, "", 112101, 0, 92, 1, 60001, "スズメ", 0, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 1, "", 0, 1, 93, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, "", 0, 1, 94, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 1, "", 0, 1, 95, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 1, "", 0, 1, 96, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 2, "", 0, 1, 97, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 1, "", 0, 2, 98, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 1, "", 0, 2, 99, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 1, "", 0, 2, 100, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 1, "", 0, 2, 101, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2, "", 0, 2, 102, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 1, "", 0, 3, 103, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 1, "", 0, 3, 104, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 1, "", 0, 3, 105, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 1, "", 0, 3, 106, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 1, "", 0, 3, 107, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 1, "", 0, 3, 108, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 2, "", 0, 3, 109, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 1, "", 0, 4, 110, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 1, "", 0, 4, 111, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 1, "", 0, 4, 112, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 1, "", 0, 4, 113, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 1, "", 0, 4, 114, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 1, "", 0, 4, 115, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2, "", 0, 4, 116, 0, 60001, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 0, "", 112101, 0, 117, 2, 60001, "スズメ", 0, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 0, "", 112101, 0, 118, 3, 60001, "スズメ", 7, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ヒューヒュー♪\nドンドンパフパフー♪", 0, "", 105801, 0, 119, 1, 80003, "ペコリーヌ", 1, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ひゅーひゅー\nどんどんぱふぱふー\nでございます", 0, "", 105901, 0, 120, 1, 80003, "コッコロ", 1, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 0, "", 105901, 0, 121, 2, 80003, "コッコロ", 1, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("え？　ちょっと\nいきなりなにっ？", 0, "", 106001, 0, 122, 1, 80003, "キャル", 1, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 0, "", 106001, 0, 123, 2, 80003, "キャル", 1, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 0, "", 105801, 0, 124, 2, 80003, "ペコリーヌ", 1, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 0, "", 105801, 0, 125, 3, 80003, "ペコリーヌ", 1, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ですからその日に向けて\n今から気分を盛り上げているのです", 0, "", 105901, 0, 126, 3, 80003, "コッコロ", 1, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 0, "", 106001, 0, 127, 3, 80003, "キャル", 1, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 0, "", 105901, 0, 128, 4, 80003, "コッコロ", 1, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 0, "", 105801, 0, 129, 4, 80003, "ペコリーヌ", 1, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 0, "", 106001, 0, 130, 4, 80003, "キャル", 1, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 0, "", 105901, 0, 131, 5, 80003, "コッコロ", 1, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 0, "", 106001, 0, 132, 5, 80003, "キャル", 2, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 0, "", 190801, 0, 133, 1, 80003, "カリン", 2, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("げっ…カリンじゃない\nなんでもないわよ！", 0, "", 106001, 0, 134, 6, 80003, "キャル", 2, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 0, "", 190801, 0, 135, 2, 80003, "カリン", 2, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 0, "", 106001, 0, 136, 7, 80003, "キャル", 2, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 0, "", 190801, 0, 137, 3, 80003, "カリン", 2, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 0, "", 106001, 0, 138, 8, 80003, "キャル", 2, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 0, "", 106001, 0, 139, 9, 80003, "キャル", 2, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 0, "", 190801, 0, 140, 4, 80003, "カリン", 2, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 0, "", 106001, 0, 141, 10, 80003, "キャル", 2, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 0, "", 190801, 0, 142, 5, 80003, "カリン", 2, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 0, "", 106001, 0, 143, 11, 80003, "キャル", 2, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 0, "", 105901, 0, 144, 6, 80003, "コッコロ", 3, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 0, "", 105801, 0, 145, 5, 80003, "ペコリーヌ", 3, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 0, "", 105901, 0, 146, 7, 80003, "コッコロ", 3, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 0, "", 105901, 0, 147, 8, 80003, "コッコロ", 3, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 0, "", 105801, 0, 148, 6, 80003, "ペコリーヌ", 3, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 0, "", 105801, 0, 149, 7, 80003, "ペコリーヌ", 3, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あとは、牧場に素敵な温泉が\n出来たとか…", 0, "", 105901, 0, 150, 9, 80003, "コッコロ", 3, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 0, "", 105801, 0, 151, 8, 80003, "ペコリーヌ", 3, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 0, "", 105901, 0, 152, 10, 80003, "コッコロ", 3, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("えへへ、ありがとうございます\nコッコロちゃん！", 0, "", 105801, 0, 153, 9, 80003, "ペコリーヌ", 3, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 0, "", 105901, 0, 154, 11, 80003, "コッコロ", 3, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 0, "", 105801, 0, 155, 10, 80003, "ペコリーヌ", 3, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 0, "", 105801, 0, 156, 11, 80003, "ペコリーヌ", 4, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 0, "", 106001, 0, 157, 12, 80003, "キャル", 4, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 0, "", 105801, 0, 158, 12, 80003, "ペコリーヌ", 4, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 0, "", 106001, 0, 159, 13, 80003, "キャル", 4, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 0, "", 105801, 0, 160, 13, 80003, "ペコリーヌ", 4, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("…積極的？\nなんの話よ？", 0, "", 106001, 0, 161, 14, 80003, "キャル", 4, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 0, "", 105801, 0, 162, 14, 80003, "ペコリーヌ", 4, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ムーサの町で\nきゃるきゃる～ん☆　って！", 0, "", 105801, 0, 163, 15, 80003, "ペコリーヌ", 4, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 0, "", 106001, 0, 164, 15, 80003, "キャル", 4, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 0, "", 105801, 0, 165, 16, 80003, "ペコリーヌ", 4, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 0, "", 106001, 0, 166, 16, 80003, "キャル", 4, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 0, "", 106001, 0, 167, 17, 80003, "キャル", 4, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 0, "", 106001, 0, 168, 18, 80003, "キャル", 5, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 0, "", 105901, 0, 169, 12, 80003, "コッコロ", 5, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 0, "", 106001, 0, 170, 19, 80003, "キャル", 5, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 0, "", 105901, 0, 171, 13, 80003, "コッコロ", 5, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 0, "", 106001, 0, 172, 20, 80003, "キャル", 5, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 0, "", 105901, 0, 173, 14, 80003, "コッコロ", 5, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 0, "", 106001, 0, 174, 21, 80003, "キャル", 5, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 0, "", 105901, 0, 175, 15, 80003, "コッコロ", 5, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("かくし芸？", 0, "", 106001, 0, 176, 22, 80003, "キャル", 5, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 0, "", 105901, 0, 177, 16, 80003, "コッコロ", 5, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 0, "", 106001, 0, 178, 23, 80003, "キャル", 5, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 0, "", 105801, 0, 179, 17, 80003, "ペコリーヌ", 6, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 0, "", 106001, 0, 180, 24, 80003, "キャル", 6, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 0, "", 105901, 0, 181, 17, 80003, "コッコロ", 6, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 0, "", 105801, 0, 182, 18, 80003, "ペコリーヌ", 6, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 0, "", 106001, 0, 183, 25, 80003, "キャル", 6, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 0, "", 105901, 0, 184, 18, 80003, "コッコロ", 6, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 0, "", 106001, 0, 185, 26, 80003, "キャル", 6, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 0, "", 106001, 0, 186, 27, 80003, "キャル", 6, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 0, "", 106001, 0, 187, 28, 80003, "キャル", 6, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 0, "", 105801, 0, 188, 19, 80003, "ペコリーヌ", 6, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 0, "", 105901, 0, 189, 19, 80003, "コッコロ", 6, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 0, "", 106001, 0, 190, 29, 80003, "キャル", 6, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 0, "", 106001, 0, 191, 30, 80003, "キャル", 7, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 0, "", 106001, 0, 192, 31, 80003, "キャル", 7, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 0, "", 106001, 0, 193, 32, 80003, "キャル", 7, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あー\nあー\n…声、これで大丈夫かしら？", 0, "", 106001, 0, 194, 33, 80003, "キャル", 7, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 0, "", 106001, 0, 195, 34, 80003, "キャル", 7, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("オイッスー☆", 0, "", 106001, 0, 196, 35, 80003, "キャル", 7, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("……\nいや、ないわ\nいつもどおりが一番ね、うん", 0, "", 106001, 0, 197, 36, 80003, "キャル", 7, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 0, "", 106001, 0, 198, 37, 80003, "キャル", 7, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ど、どど、どうしよう！？\n緊張してきちゃった…！！", 0, "", 106001, 0, 199, 38, 80003, "キャル", 7, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 0, "", 105901, 0, 200, 20, 80003, "コッコロ", 8, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 0, "", 105901, 0, 201, 21, 80003, "コッコロ", 8, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 0, "", 105901, 0, 202, 22, 80003, "コッコロ", 8, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 0, "", 105901, 0, 203, 23, 80003, "コッコロ", 8, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 0, "", 105901, 0, 204, 24, 80003, "コッコロ", 8, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("オイッスー☆", 0, "", 105901, 0, 205, 25, 80003, "コッコロ", 8, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 0, "", 105901, 0, 206, 26, 80003, "コッコロ", 8, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 0, "", 105901, 0, 207, 27, 80003, "コッコロ", 8, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 0, "", 105901, 0, 208, 28, 80003, "コッコロ", 8, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("オイッスー☆", 0, "", 105801, 0, 209, 20, 80003, "ペコリーヌ", 9, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 0, "", 105801, 0, 210, 21, 80003, "ペコリーヌ", 9, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あと６日で2.5周年ですか…", 0, "", 105801, 0, 211, 22, 80003, "ペコリーヌ", 9, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 0, "", 105801, 0, 212, 23, 80003, "ペコリーヌ", 9, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 0, "", 105801, 0, 213, 24, 80003, "ペコリーヌ", 9, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("オイッスー☆", 0, "", 105801, 0, 214, 25, 80003, "ペコリーヌ", 9, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 0, "", 105801, 0, 215, 26, 80003, "ペコリーヌ", 9, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 0, "", 105801, 0, 216, 27, 80003, "ペコリーヌ", 9, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 0, "", 105801, 0, 217, 28, 80003, "ペコリーヌ", 9, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 0, "", 105801, 0, 218, 29, 80003, "ペコリーヌ", 9, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 0, "", 105801, 0, 219, 30, 80003, "ペコリーヌ", 9, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 0, "", 105801, 0, 220, 31, 80003, "ペコリーヌ", 10, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 0, "", 105901, 0, 221, 29, 80003, "コッコロ", 10, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 0, "", 105801, 0, 222, 32, 80003, "ペコリーヌ", 10, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("…………", 0, "", 106001, 0, 223, 39, 80003, "キャル", 10, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 0, "", 105901, 0, 224, 30, 80003, "コッコロ", 10, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 0, "", 106001, 0, 225, 40, 80003, "キャル", 10, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 0, "", 105801, 0, 226, 33, 80003, "ペコリーヌ", 10, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 0, "", 106001, 0, 227, 41, 80003, "キャル", 10, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 0, "", 105801, 0, 228, 34, 80003, "ペコリーヌ", 10, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 0, "", 105801, 0, 229, 35, 80003, "ペコリーヌ", 10, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 0, "", 106001, 0, 230, 42, 80003, "キャル", 10, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 0, "", 105901, 0, 231, 31, 80003, "コッコロ", 10, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 0, "", 106001, 0, 232, 43, 80003, "キャル", 10, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 0, "", 105801, 0, 233, 36, 80003, "ペコリーヌ", 10, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 0, "", 190801, 0, 234, 6, 80003, "カリン", 11, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 0, "", 190801, 0, 235, 7, 80003, "カリン", 11, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 0, "", 190801, 0, 236, 8, 80003, "カリン", 11, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 0, "", 190801, 0, 237, 9, 80003, "カリン", 11, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 0, "", 190801, 0, 238, 10, 80003, "カリン", 11, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("次にコッコロさんですが\nこちらは発声練習をしています", 0, "", 190801, 0, 239, 11, 80003, "カリン", 11, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 0, "", 190801, 0, 240, 12, 80003, "カリン", 11, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 0, "", 190801, 0, 241, 13, 80003, "カリン", 11, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あれ？\nもしかして緊張で気を失って…？", 0, "", 190801, 0, 242, 14, 80003, "カリン", 11, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 0, "", 190801, 0, 243, 15, 80003, "カリン", 11, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 0, "", 190801, 0, 244, 16, 80003, "カリン", 11, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("それでは\nまた明日お会いしましょう♪", 0, "", 190801, 0, 245, 17, 80003, "カリン", 11, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 0, "", 106001, 0, 246, 44, 80003, "キャル", 12, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 0, "", 105801, 0, 247, 37, 80003, "ペコリーヌ", 12, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 0, "", 105901, 0, 248, 32, 80003, "コッコロ", 12, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 0, "", 106001, 0, 249, 45, 80003, "キャル", 12, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ひどいですよぉキャルちゃ～ん！", 0, "", 105801, 0, 250, 38, 80003, "ペコリーヌ", 12, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 0, "", 105901, 0, 251, 33, 80003, "コッコロ", 12, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 0, "", 105801, 0, 252, 39, 80003, "ペコリーヌ", 12, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 0, "", 106001, 0, 253, 46, 80003, "キャル", 12, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 0, "", 105901, 0, 254, 34, 80003, "コッコロ", 12, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 0, "", 105801, 0, 255, 40, 80003, "ペコリーヌ", 12, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 0, "", 105801, 0, 256, 41, 80003, "ペコリーヌ", 13, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 0, "", 106001, 0, 257, 47, 80003, "キャル", 13, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("忘れてきちゃいました☆", 0, "", 105801, 0, 258, 42, 80003, "ペコリーヌ", 13, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 0, "", 106001, 0, 259, 48, 80003, "キャル", 13, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 0, "", 105901, 0, 260, 35, 80003, "コッコロ", 13, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 0, "", 106001, 0, 261, 49, 80003, "キャル", 13, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 0, "", 105801, 0, 262, 43, 80003, "ペコリーヌ", 13, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 0, "", 106001, 0, 263, 50, 80003, "キャル", 13, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 0, "", 105901, 0, 264, 36, 80003, "コッコロ", 13, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 0, "", 106001, 0, 265, 51, 80003, "キャル", 13, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 0, "", 105901, 0, 266, 37, 80003, "コッコロ", 13, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 0, "", 106001, 0, 267, 52, 80003, "キャル", 13, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 0, "", 105801, 0, 268, 44, 80003, "ペコリーヌ", 13, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 0, "", 105901, 0, 269, 38, 80003, "コッコロ", 13, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 0, "", 105801, 0, 270, 45, 80003, "ペコリーヌ", 13, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 0, "", 106001, 0, 271, 53, 80003, "キャル", 13, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 0, "", 105801, 0, 272, 46, 80003, "ペコリーヌ", 13, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("こんにちは\n【ギルド管理協会】のカリンです", 0, "", 190801, 0, 273, 18, 80003, "カリン", 14, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("昨日の生放送は\nいかがだったでしょうか？", 0, "", 190801, 0, 274, 19, 80003, "カリン", 14, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 0, "", 190801, 0, 275, 20, 80003, "カリン", 14, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 0, "", 190801, 0, 276, 21, 80003, "カリン", 14, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 0, "", 190801, 0, 277, 22, 80003, "カリン", 14, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 0, "", 190801, 0, 278, 23, 80003, "カリン", 14, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 0, "", 190801, 0, 279, 24, 80003, "カリン", 14, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 0, "", 190801, 0, 280, 25, 80003, "カリン", 14, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 0, "", 190801, 0, 281, 26, 80003, "カリン", 14, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 0, "", 190801, 0, 282, 27, 80003, "カリン", 14, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("準備はいいですかっ？\n…いっきますよー！", 0, "", 105801, 0, 283, 47, 80003, "ペコリーヌ", 15, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("祝！", 0, "", 106001, 0, 284, 54, 80003, "キャル", 15, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("2.5周年！", 0, "", 105901, 0, 285, 39, 80003, "コッコロ", 15, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("おめでとうございま～す☆", 0, "", 105801, 0, 286, 48, 80003, "ペコリーヌ", 15, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 0, "", 106001, 0, 287, 55, 80003, "キャル", 15, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 0, "", 105901, 0, 288, 40, 80003, "コッコロ", 15, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 0, "", 105801, 0, 289, 49, 80003, "ペコリーヌ", 15, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 0, "", 106001, 0, 290, 56, 80003, "キャル", 15, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 0, "", 105901, 0, 291, 41, 80003, "コッコロ", 15, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 0, "", 106001, 0, 292, 57, 80003, "キャル", 15, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 0, "", 105801, 0, 293, 50, 80003, "ペコリーヌ", 15, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 0, "", 106001, 0, 294, 58, 80003, "キャル", 15, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("記念日だから\n平気平気♪\nやばいですね☆", 0, "", 105801, 0, 295, 51, 80003, "ペコリーヌ", 15, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("意味分かんないわよ！", 0, "", 106001, 0, 296, 59, 80003, "キャル", 15, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 0, "", 105901, 0, 297, 42, 80003, "コッコロ", 15, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 0, "", 105901, 0, 298, 43, 80003, "コッコロ", 15, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 0, "", 105801, 0, 299, 52, 80003, "ペコリーヌ", 15, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 0, "", 106001, 0, 300, 60, 80003, "キャル", 15, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 0, "", 105901, 0, 301, 44, 80003, "コッコロ", 15, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 0, "", 105801, 0, 302, 53, 80003, "ペコリーヌ", 15, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("2.5周年\nありがとうございます！", 0, "105901,45,106001,61", 105801, 0, 303, 54, 80003, "ペコリーヌ・コッコロ・キャル", 15, 0, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, "", 190804, 0, 304, 1, 60002, "カリン", 0, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 1, "", 0, 1, 305, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, "", 0, 1, 306, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 1, "", 0, 1, 307, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 1, "", 0, 1, 308, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 2, "", 0, 1, 309, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 1, "", 0, 2, 310, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 1, "", 0, 2, 311, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 1, "", 0, 2, 312, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 1, "", 0, 2, 313, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 2, "", 0, 2, 314, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 1, "", 0, 3, 315, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 1, "", 0, 3, 316, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 1, "", 0, 3, 317, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 1, "", 0, 3, 318, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 1, "", 0, 3, 319, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 1, "", 0, 3, 320, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 2, "", 0, 3, 321, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 1, "", 0, 4, 322, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 1, "", 0, 4, 323, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 1, "", 0, 4, 324, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 1, "", 0, 4, 325, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 1, "", 0, 4, 326, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 1, "", 0, 4, 327, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2, "", 0, 4, 328, 0, 60002, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, "", 190804, 0, 329, 2, 60002, "カリン", 0, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0, "", 190804, 0, 330, 3, 60002, "カリン", 7, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ささ、シェフィさまはこちらへ…", 0, "", 105901, 0, 331, 1, 80005, "コッコロ", 1, 4, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("コッコロさん、どこへ行くの…？\n…え？", 0, "", 106401, 0, 332, 1, 80005, "シェフィ", 1, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 0, "", 105801, 0, 333, 1, 80005, "ペコリーヌ", 1, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 0, "", 105901, 0, 334, 2, 80005, "コッコロ", 1, 4, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ええと…\n二人とも何をしているの？", 0, "", 106401, 0, 335, 2, 80005, "シェフィ", 1, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 0, "", 106001, 0, 336, 1, 80005, "キャル", 1, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あの日…？", 0, "", 106401, 0, 337, 3, 80005, "シェフィ", 1, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 0, "", 105801, 0, 338, 2, 80005, "ペコリーヌ", 1, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("『プリンセスコネクト！\nRe:Dive』3.5周年！", 0, "", 105801, 0, 339, 3, 80005, "ペコリーヌ", 1, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("やばいですね☆", 0, "", 190801, 0, 340, 1, 80005, "カリン", 1, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("って、なにしれっと\n参加してんのよカリン！", 0, "", 106001, 0, 341, 2, 80005, "キャル", 1, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 0, "", 190801, 0, 342, 2, 80005, "カリン", 1, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 0, "", 190801, 0, 343, 3, 80005, "カリン", 1, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 0, "", 105801, 0, 344, 4, 80005, "ペコリーヌ", 1, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("えっ！？　ええとええと…！\nあ、あと14日…！", 0, "", 106401, 0, 345, 4, 80005, "シェフィ", 1, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 0, "", 105801, 0, 346, 5, 80005, "ペコリーヌ", 2, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 0, "", 105901, 0, 347, 3, 80005, "コッコロ", 2, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 0, "", 105901, 0, 348, 4, 80005, "コッコロ", 2, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 0, "", 105801, 0, 349, 6, 80005, "ペコリーヌ", 2, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("さすがでございます\nペコリーヌさま", 0, "", 105901, 0, 350, 5, 80005, "コッコロ", 2, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 0, "", 106001, 0, 351, 3, 80005, "キャル", 2, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("しゃなり、しゃなり…\nふふ、案外できるものね", 0, "", 106401, 0, 352, 5, 80005, "シェフィ", 2, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 0, "", 105801, 0, 353, 7, 80005, "ペコリーヌ", 2, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("さ、次はキャルさまの\n番でございますよ", 0, "", 105901, 0, 354, 6, 80005, "コッコロ", 2, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あ、あたしはいいわよ！\nそういうの全然分かんないし…", 0, "", 106001, 0, 355, 4, 80005, "キャル", 2, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 0, "", 106401, 0, 356, 6, 80005, "シェフィ", 2, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 0, "", 106001, 0, 357, 5, 80005, "キャル", 2, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("いたたた…もぉお～！\nなんであたしがこんな目に～！", 0, "", 106001, 0, 358, 6, 80005, "キャル", 2, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 0, "", 105901, 0, 359, 7, 80005, "コッコロ", 2, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 0, "", 106001, 0, 360, 7, 80005, "キャル", 2, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 0, "", 105901, 0, 361, 8, 80005, "コッコロ", 3, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 0, "", 105801, 0, 362, 8, 80005, "ペコリーヌ", 3, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 0, "", 105901, 0, 363, 9, 80005, "コッコロ", 3, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("聖学祭…って、なにかしら？", 0, "", 106401, 0, 364, 7, 80005, "シェフィ", 3, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 0, "", 105901, 0, 365, 10, 80005, "コッコロ", 3, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 0, "", 106001, 0, 366, 8, 80005, "キャル", 3, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 0, "", 106001, 0, 367, 9, 80005, "キャル", 3, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 0, "", 105801, 0, 368, 9, 80005, "ペコリーヌ", 3, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("いや、そのまんますぎでしょ…", 0, "", 106001, 0, 369, 10, 80005, "キャル", 3, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 0, "", 106401, 0, 370, 8, 80005, "シェフィ", 3, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 0, "", 105801, 0, 371, 10, 80005, "ペコリーヌ", 3, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("えっ？　ええ…\nぎゅーっ…？", 0, "", 106401, 0, 372, 9, 80005, "シェフィ", 3, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 0, "", 106001, 0, 373, 11, 80005, "キャル", 4, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 0, "", 106401, 0, 374, 10, 80005, "シェフィ", 4, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 0, "", 106001, 0, 375, 12, 80005, "キャル", 4, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 0, "", 105901, 0, 376, 11, 80005, "コッコロ", 4, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 0, "", 106001, 0, 377, 13, 80005, "キャル", 4, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 0, "", 105801, 0, 378, 11, 80005, "ペコリーヌ", 4, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 0, "", 106001, 0, 379, 14, 80005, "キャル", 4, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 0, "", 106001, 0, 380, 15, 80005, "キャル", 4, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 0, "", 106401, 0, 381, 11, 80005, "シェフィ", 4, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 0, "", 105801, 0, 382, 12, 80005, "ペコリーヌ", 4, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 0, "", 105901, 0, 383, 12, 80005, "コッコロ", 4, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 0, "", 106001, 0, 384, 16, 80005, "キャル", 4, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 0, "", 106401, 0, 385, 12, 80005, "シェフィ", 4, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 0, "", 105801, 0, 386, 13, 80005, "ペコリーヌ", 5, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 0, "", 105801, 0, 387, 14, 80005, "ペコリーヌ", 5, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 0, "", 105801, 0, 388, 15, 80005, "ペコリーヌ", 5, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 0, "", 106001, 0, 389, 17, 80005, "キャル", 5, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 0, "", 106001, 0, 390, 18, 80005, "キャル", 5, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 0, "", 106401, 0, 391, 13, 80005, "シェフィ", 5, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 0, "", 105901, 0, 392, 13, 80005, "コッコロ", 5, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 0, "", 105801, 0, 393, 16, 80005, "ペコリーヌ", 5, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 0, "", 106001, 0, 394, 19, 80005, "キャル", 5, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 0, "", 105801, 0, 395, 17, 80005, "ペコリーヌ", 5, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 0, "", 105801, 0, 396, 18, 80005, "ペコリーヌ", 5, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 0, "", 105801, 0, 397, 19, 80005, "ペコリーヌ", 5, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 0, "", 190801, 0, 398, 4, 80005, "カリン", 6, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 0, "", 190801, 0, 399, 5, 80005, "カリン", 6, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("…えっ！？", 0, "", 106001, 0, 400, 20, 80005, "キャル", 6, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 0, "", 105801, 0, 401, 20, 80005, "ペコリーヌ", 6, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 0, "", 106401, 0, 402, 14, 80005, "シェフィ", 6, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 0, "", 105901, 0, 403, 14, 80005, "コッコロ", 6, 4, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 0, "", 106401, 0, 404, 15, 80005, "シェフィ", 6, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 0, "", 106001, 0, 405, 21, 80005, "キャル", 6, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 0, "", 105801, 0, 406, 21, 80005, "ペコリーヌ", 6, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ぶっ殺すぞ！？", 0, "", 106001, 0, 407, 22, 80005, "キャル", 6, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 0, "", 190801, 0, 408, 6, 80005, "カリン", 6, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 0, "", 105901, 0, 409, 15, 80005, "コッコロ", 7, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 0, "", 106001, 0, 410, 23, 80005, "キャル", 7, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 0, "", 106401, 0, 411, 16, 80005, "シェフィ", 7, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 0, "", 105801, 0, 412, 22, 80005, "ペコリーヌ", 7, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 0, "", 106001, 0, 413, 24, 80005, "キャル", 7, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 0, "", 106401, 0, 414, 17, 80005, "シェフィ", 7, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 0, "", 105901, 0, 415, 16, 80005, "コッコロ", 7, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 0, "", 106401, 0, 416, 18, 80005, "シェフィ", 7, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("もちろんでございます\n仲良くお勉強いたしましょう", 0, "", 105901, 0, 417, 17, 80005, "コッコロ", 7, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("しれっと教育ママが\n生まれてる…？", 0, "", 106001, 0, 418, 25, 80005, "キャル", 7, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 0, "", 105801, 0, 419, 23, 80005, "ペコリーヌ", 7, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("え～～～～！？", 0, "", 106001, 0, 420, 26, 80005, "キャル", 7, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 0, "", 106001, 0, 421, 27, 80005, "キャル", 8, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("…\nねぇコッコロさん\nキャル、どうしちゃったの？", 0, "", 106401, 0, 422, 19, 80005, "シェフィ", 8, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 0, "", 105901, 0, 423, 18, 80005, "コッコロ", 8, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 0, "", 105801, 0, 424, 24, 80005, "ペコリーヌ", 8, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 0, "", 106401, 0, 425, 20, 80005, "シェフィ", 8, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 0, "", 106001, 0, 426, 28, 80005, "キャル", 8, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 0, "", 105901, 0, 427, 19, 80005, "コッコロ", 8, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 0, "", 106401, 0, 428, 21, 80005, "シェフィ", 8, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 0, "", 106001, 0, 429, 29, 80005, "キャル", 8, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 0, "", 106001, 0, 430, 30, 80005, "キャル", 8, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 0, "", 105801, 0, 431, 25, 80005, "ペコリーヌ", 8, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 0, "", 106001, 0, 432, 31, 80005, "キャル", 8, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 0, "", 106401, 0, 433, 22, 80005, "シェフィ", 9, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("…えっ？\n生放送の意気込み！？\n突然なに！？", 0, "", 106401, 0, 434, 23, 80005, "シェフィ", 9, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 0, "", 106401, 0, 435, 24, 80005, "シェフィ", 9, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 0, "", 106401, 0, 436, 25, 80005, "シェフィ", 9, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("とにかく落ち着いて\nスタッフさんの指示を聞いて…", 0, "", 106401, 0, 437, 26, 80005, "シェフィ", 9, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("それから、それから…！\nぅ、ぅぅっ…！", 0, "", 106401, 0, 438, 27, 80005, "シェフィ", 9, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("―びえぇぇ～んっ！！！", 0, "", 106401, 0, 439, 28, 80005, "シェフィ", 9, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("どうされましたか、シェフィさま", 0, "", 105901, 0, 440, 20, 80005, "コッコロ", 9, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ううっ…ひっく…\nママッ…！", 0, "", 106401, 0, 441, 29, 80005, "シェフィ", 9, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 0, "", 105901, 0, 442, 21, 80005, "コッコロ", 9, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 0, "", 105901, 0, 443, 22, 80005, "コッコロ", 9, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 0, "", 106401, 0, 444, 30, 80005, "シェフィ", 9, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("主さま\n3.5周年まであと５日\nでございます", 0, "", 105901, 0, 445, 23, 80005, "コッコロ", 10, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ですがその前に\n生放送がありますね", 0, "", 105901, 0, 446, 24, 80005, "コッコロ", 10, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("…生放送に向けた\n意気込みでございますか？", 0, "", 105901, 0, 447, 25, 80005, "コッコロ", 10, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 0, "", 105901, 0, 448, 26, 80005, "コッコロ", 10, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 0, "", 105901, 0, 449, 27, 80005, "コッコロ", 10, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 0, "", 105901, 0, 450, 28, 80005, "コッコロ", 10, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 0, "", 105901, 0, 451, 29, 80005, "コッコロ", 10, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 0, "", 105901, 0, 452, 30, 80005, "コッコロ", 10, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 0, "", 105901, 0, 453, 31, 80005, "コッコロ", 10, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("3.5周年まであと４日！\nやばいですね☆", 0, "", 105801, 0, 454, 26, 80005, "ペコリーヌ", 11, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 0, "", 106001, 0, 455, 32, 80005, "キャル", 11, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 0, "", 105801, 0, 456, 27, 80005, "ペコリーヌ", 11, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 0, "", 105801, 0, 457, 28, 80005, "ペコリーヌ", 11, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 0, "", 105801, 0, 458, 29, 80005, "ペコリーヌ", 11, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 0, "", 106001, 0, 459, 33, 80005, "キャル", 11, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 0, "", 105801, 0, 460, 30, 80005, "ペコリーヌ", 11, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 0, "", 105801, 0, 461, 31, 80005, "ペコリーヌ", 11, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 0, "", 105801, 0, 462, 32, 80005, "ペコリーヌ", 11, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("だからあたしはやるなんて一言も…", 0, "", 106001, 0, 463, 34, 80005, "キャル", 11, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("オイッスー☆", 0, "", 105801, 0, 464, 33, 80005, "ペコリーヌ", 11, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("聞きなさいっての！！", 0, "", 106001, 0, 465, 35, 80005, "キャル", 11, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("3.5周年まであと３日…\nそして生放送は、明日…", 0, "", 106401, 0, 466, 31, 80005, "シェフィ", 12, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 0, "", 106401, 0, 467, 32, 80005, "シェフィ", 12, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("おいっす！\n…こうじゃなかったわね\nええと確か…", 0, "", 106401, 0, 468, 33, 80005, "シェフィ", 12, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 0, "", 106401, 0, 469, 34, 80005, "シェフィ", 12, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 0, "", 106401, 0, 470, 35, 80005, "シェフィ", 12, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("やってますねシェフィちゃん！", 0, "", 105801, 0, 471, 34, 80005, "ペコリーヌ", 12, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("なによ、考えることは\nみんな同じってこと？", 0, "", 106001, 0, 472, 36, 80005, "キャル", 12, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 0, "", 105901, 0, 473, 32, 80005, "コッコロ", 12, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("みんな…もちろんよ！", 0, "", 106401, 0, 474, 36, 80005, "シェフィ", 12, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 0, "", 105801, 0, 475, 35, 80005, "ペコリーヌ", 12, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 0, "", 190801, 0, 476, 7, 80005, "カリン", 13, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 0, "", 190801, 0, 477, 8, 80005, "カリン", 13, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 0, "", 105801, 0, 478, 36, 80005, "ペコリーヌ", 13, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 0, "", 190801, 0, 479, 9, 80005, "カリン", 13, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 0, "", 105901, 0, 480, 33, 80005, "コッコロ", 13, 4, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("さすが【美食殿】のママですね！\nそしてキャルさんは…", 0, "", 190801, 0, 481, 10, 80005, "カリン", 13, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("大丈夫…大丈夫…\nあたしは大丈夫…", 0, "", 106001, 0, 482, 37, 80005, "キャル", 13, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 0, "", 190801, 0, 483, 11, 80005, "カリン", 13, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あうー？", 0, "", 106401, 0, 484, 37, 80005, "シェフィ", 13, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("あ…", 0, "105901,34,106001,38,190801,12", 105801, 0, 485, 37, 80005, "みんな", 13, 4, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 0, "", 106001, 0, 486, 39, 80005, "キャル", 13, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 0, "", 105901, 0, 487, 35, 80005, "コッコロ", 13, 4, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 0, "", 105801, 0, 488, 38, 80005, "ペコリーヌ", 13, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 0, "", 190801, 0, 489, 13, 80005, "カリン", 13, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 0, "", 106401, 0, 490, 38, 80005, "シェフィ", 14, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 0, "", 105801, 0, 491, 39, 80005, "ペコリーヌ", 14, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 0, "", 106001, 0, 492, 40, 80005, "キャル", 14, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 0, "", 105901, 0, 493, 36, 80005, "コッコロ", 14, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 0, "", 106401, 0, 494, 39, 80005, "シェフィ", 14, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 0, "", 105801, 0, 495, 40, 80005, "ペコリーヌ", 14, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 0, "", 105901, 0, 496, 37, 80005, "コッコロ", 14, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 0, "", 106001, 0, 497, 41, 80005, "キャル", 14, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("へ、へぇ…", 0, "", 106401, 0, 498, 40, 80005, "シェフィ", 14, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 0, "", 105801, 0, 499, 41, 80005, "ペコリーヌ", 14, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 0, "", 106401, 0, 500, 41, 80005, "シェフィ", 14, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 0, "", 106401, 0, 501, 42, 80005, "シェフィ", 14, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 0, "", 105801, 0, 502, 42, 80005, "ペコリーヌ", 15, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("祝！", 0, "", 106001, 0, 503, 42, 80005, "キャル", 15, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("3.5周年！", 0, "", 105901, 0, 504, 38, 80005, "コッコロ", 15, 4, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("おめでとうございます！", 0, "", 106401, 0, 505, 43, 80005, "シェフィ", 15, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 0, "", 190801, 0, 506, 14, 80005, "カリン", 15, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 0, "", 190801, 0, 507, 15, 80005, "カリン", 15, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 0, "", 105801, 0, 508, 43, 80005, "ペコリーヌ", 15, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 0, "", 105801, 0, 509, 44, 80005, "ペコリーヌ", 15, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 0, "", 106001, 0, 510, 43, 80005, "キャル", 15, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 0, "", 106001, 0, 511, 44, 80005, "キャル", 15, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 0, "", 106401, 0, 512, 44, 80005, "シェフィ", 15, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 0, "", 106401, 0, 513, 45, 80005, "シェフィ", 15, 0, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 0, "", 105901, 0, 514, 39, 80005, "コッコロ", 15, 4, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 0, "", 105901, 0, 515, 40, 80005, "コッコロ", 15, 4, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 0, "", 105901, 0, 516, 41, 80005, "コッコロ", 15, 4, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 0, "", 105801, 0, 517, 45, 80005, "ペコリーヌ", 15, 3, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("これからも\nよろしくおねがいします！", 0, "105901,42,106001,45,106401,46,190801,16", 105801, 0, 518, 46, 80005, "みんな", 15, 4, 1);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, "", 190804, 0, 519, 1, 60003, "カリン", 0, 1, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 1, "", 0, 1, 520, 0, 60003, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, "", 0, 1, 521, 0, 60003, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 1, "", 0, 1, 522, 0, 60003, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 1, "", 0, 1, 523, 0, 60003, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 2, "", 0, 1, 524, 0, 60003, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 1, "", 0, 2, 525, 0, 60003, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 1, "", 0, 2, 526, 0, 60003, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 1, "", 0, 2, 527, 0, 60003, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 1, "", 0, 2, 528, 0, 60003, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 2, "", 0, 2, 529, 0, 60003, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 1, "", 0, 3, 530, 0, 60003, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 1, "", 0, 3, 531, 0, 60003, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 1, "", 0, 3, 532, 0, 60003, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 1, "", 0, 3, 533, 0, 60003, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 1, "", 0, 3, 534, 0, 60003, "", 0, 2, 0);
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES ("今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 1, "", 0, 3, 535, 0, 60003, "", 0, 2, 0);
